import React, { Component } from 'react';
import './App.css';
class App extends Component {
  state = {
    resultCount: 0
  };
  searchZillow = async (event) => {
    event.preventDefault();
    let response = await fetch('/zillow');
    let body = await response.json();
    this.setState({ resultCount: body.searchList.totalResultCount });
  }
  render() {
    const {greeting, isLoading} = this.state;
    return (
<div className="App">
<header className="App-header">
<div class="tab">
  <button class="tablinks" onclick="openCity(event, 'US')">London</button>
  <button class="tablinks" onclick="openCity(event, 'Ireland')">Paris</button>
  <button class="tablinks" onclick="openCity(event, 'Tokyo')">Tokyo</button>
</div>
            <button onClick={(event)=>this.searchZillow(event)}>US Results</button>
<h2>Properties Found {this.state.resultCount}</h2>
        </header>
    </div>
    );
  }
}
export default App;
